import React from "react";
import ReactDOM from "react-dom";

function Header() {
    return (
        <header>
            <nav className="nav">
                <img src="../public/github-mark.png"/>
            </nav>
        </header>
    )
};

function MainContent() {

}

function Footer() {

}

function WholePage() {
    return (
        <div>
            <Header />
            <MainContent />
            <Footer />
        </div>
    )
 }

ReactDOM.render(<WholePage />, document.getElementById("root"));
